drop table Food;

create table Food(
    ID SERIAL not null,
    TITLE varchar(254) not null,
    SYN varchar(254),
    CAT varchar(254),
    UNIT varchar(255),
    KILOJOULE integer,
    FAT_TOTAL numeric,
    FAT_SATURATED numeric,
    FAT_UNSATURATED_SINGLE numeric,
    FAT_UNSATURATED_MULTIPLE numeric,
    CARBOHYDRATE_AVAILABLE numeric,
    SUGAR numeric,
    FIBRE numeric,
    PROTEIN numeric,
    WATER numeric
);


